import React, { Component } from 'react';
import { Jumbotron,Container} from 'react-bootstrap';
class About extends Component {
  render() {
    return (
      <Jumbotron fluid>
  <Container>
    <h1>About the Company</h1>
    <p>This company is an organization focused on aiding not only our customers, but our contractors as well.
    </p>
  </Container>
</Jumbotron>
      

        
        )
        
    }
}

export default About;
